import React from 'react';
//import "../styles/Work.css";
import ProjectItem from '../components/ProjectItem';
import MentorMatcher from '../assets/mentormatcher.png';

function Work() {
    return (<div className="work">
        <div className="bg">
            <img className="background" src="../images/sky_background.jpg" alt=""/>

        </div>

        <h1 className="title">My Work</h1>
        <div className="projectList">
            <ProjectItem name="Mentor Matcher - UX Design" image ={MentorMatcher}/>
            <ProjectItem name="Teal EVents - UX Design" />
        </div>

    </div>);
}

export default Work;
